INSERT INTO `uni1_messages` (`message_id`, `message_owner`, `message_sender`, `message_time`, `message_type`, `message_from`, `message_subject`, `message_text`, `message_unread`, `message_universe`) VALUES (525,17,0,1374037484,5,'Flottenhauptquatier','Flottenrückkehr','Eine deiner Flotten kehrt zum Planeten FiSu <a href=\"game.php?page=galaxy&amp;galaxy=1&amp;system=15\" class=\"\">[1:15:5]</a> zurück.',0,1),(526,7,0,1374038533,99,'Bauliste','Bau nicht möglich','Sie verfügen auf Planet Skaro <a href=\"?page=buildings&amp;cp=33&amp;re=0\">[1:5:6]</a> nicht über genügend Ressourcen, um mit dem Bau von Solarkraftwerk zu beginnen. <br>Sie verfügen über 9.668 Metall , 30.327 Kristall und 14.086 Deuterium. <br>Die Baukosten betragen 9.731 Metall , 3.892 Kristall und 0 Deuterium.',0,1),(535,7,0,1374052268,0,'Raumüberwachung','Spionage-Aktivität','Eine feindliche Flotte vom Planeten Babylon5<a href=\"game.php?page=galaxy&amp;galaxy=1&amp;system=1\">[1:1:8]</a> wurde in der Nähe deines Planeten Raxacoricofallapator [1:5:7] gesichtet.',0,1),(537,7,0,1374052277,0,'Raumüberwachung','Spionage-Aktivität','Eine feindliche Flotte vom Planeten Babylon5<a href=\"game.php?page=galaxy&amp;galaxy=1&amp;system=1\">[1:1:8]</a> wurde in der Nähe deines Planeten Skaro [1:5:6] gesichtet.',0,1),(538,7,3,1374052356,1,'Devil [1:1:8]','danke','hat jetzt endlich gezählt, !!! <br>\n<br>\nLG Werner',0,1),(541,7,1,1374053429,1,'Markt','Markt','Dein Angebot wurde von  Gehmal gekauft, Es wurden : 0 Metall, 10.000 Kristall, 0 Deuterium, gegen  25.000 Metall, 0 Kristall, 0 Deuterium getauscht',0,1),(543,7,1,1374054662,1,'Markt','Markt','Dein Angebot wurde von  Devil gekauft, Es wurden : 0 Metall, 10.000 Kristall, 0 Deuterium, gegen  25.000 Metall, 0 Kristall, 0 Deuterium getauscht',0,1),(568,7,0,1374065592,99,'Bauliste','Bau nicht möglich','Sie verfügen auf Planet Skaro <a href=\"?page=buildings&amp;cp=33&amp;re=0\">[1:5:6]</a> nicht über genügend Ressourcen, um mit dem Bau von Kristallmine zu beginnen.