port Ticket #13','Es wurde auf Ihr Ticket #13 eine Antwort geschrieben!',0,1),(995,7,7,1374259503,2,'Allianz TL','Allianzen','Der Spieler master schreibt folgendes:<br>\r\nEs besteht ein Geheimbündniss mit den Admins.<br>\nDesweiteren stellt die Plage Antrag auf NAP! ich sage nein, mehrheit entscheidet!<br>\n<br>\nIch hatte heute keine Zeit zu spielen bin aber wieder am Aufholen.<br>\nIch benötige Dringend  200k  Metall, habe viel Kristall und gut Deut, also meldet euch und Tauscht, einen festen kurs gibt es nicht .<br>\n<br>\nWenn ihr wünsche gemäss dem Allianzaufbau habt oder Rechte keine Ahnung dann meldet euch.<br>\ngreetz',0,1),(999,7,7,1374259746,2,'Allianz TL','Angriffe','Der Spieler master schreibt folgendes:<br>\r\nIch würde gern im Lauf der nächsten Woche echte Angriffe fliegen, dazu sollten wir uns einen Tag aussuchen, damit ich dann entsprechend Fleet hochziehen kann.<br>\n<br>\nDie Angriffe sollen so gestaltet sein, zumindest am Beginn das wir gerade so Gewinnen, wer Ahnung hat und es sich zutraut, der Posten des Taktischen Rates wird vergeb.<br>\nBei Interesse melden, bei nicht interesse bitte auch melden, sonst glaub ich noch ich schreib mit mir alleine ^^!<br>\n<br>\ngreetz master<br>\n<br>\nPS: der erste Doctor auf dem Server musssss in unsere Allianz, also haltet diue Augen offen ....',0,1),(1010,7,3,1374261144,2,'Allianz TL','test','Der Spieler Devil schreibt folgendes:<br>\r\ntest',0,1),(1054,7,1,1374311224,1,'Markt','Markt','Dein Angebot wurde von  John gekauft, Es wurden : 0 Metall, 25.000 Kristall, 0 Deuterium, gegen  50.000 Metall, 0 Kristall, 0 Deuterium getauscht',0,1),(1055,7,1,1374311320,1,'Markt','Markt','Dein Angebot wurde von  Devil gekauft, Es wurden : 0 Metall, 50.000 Kristall, 0 Deuterium, gegen  0 Metall, 0 Kristall, 25.000 Deuterium getauscht',0,1),(1064,7,0,1374313957,5,'Flottenhauptquatier','Stationierte Flotte','Deine Flotte erreicht den Planeten <a href=\"game.php?page=galaxy&amp;galaxy=1&amp;system=5\" class=\"\">[1:5:7]</a> 