?',0,1),(1866,1,0,1374554665,99,'Bauliste','Bau nicht möglich','Sie verfügen auf Planet sieben <a href=\"?page=buildings&amp;cp=57&amp;re=0\">[1:3:8]</a> nicht über genügend Ressourcen, um mit dem Bau von Solarkraftwerk zu beginnen. <br>Sie verfügen über 106.758 Metall , 220.431 Kristall und 71.547 Deuterium. <br>Die Baukosten betragen 166.263 Metall , 66.505 Kristall und 0 Deuterium.',0,1),(1869,1,0,1374558855,15,'Flottenhauptquatier','Expeditionsbericht','Der Sternwind eines roten Riesen verfälschte den Sprung der Expedition dermaßen, dass es einige Zeit dauerte, den Rücksprung zu berechnen. Davon abgesehen gab es in dem Sektor, in dem die Expedition herauskam, nichts außer der Leere zwischen den Sternen.',0,1),(1870,1,0,1374558870,15,'Flottenhauptquatier','Expeditionsbericht','Deine Expedition hat einen kleinen Asteroidenschwarm entdeckt, aus dem einige Ressourcen gewonnen werden können.',0,1),(1871,1,0,1374560247,15,'Flottenhauptquatier','Expeditionsbericht','Deine Flotte ist von der Expedition wieder zurükgekehrt.<br>Sie haben Metall 0, Kristall 0, Deuterium 14.333 und Dunkle Materie 0 mitgebracht.',0,1),(1872,29,1,1374561761,1,'Administrator','Willkommen','Willkommen bei Space of Legends! Baue zuerst ein Solarkraftwerk, denn Energie wird für die spätere Rohstoffproduktion benötigt. Um diese zu bauen, klicke links im Menu auf \"Gebäude\". Danach baue das 4. Gebäude von oben. Da du nun Energie hast, kannst du anfangen Minen zu bauen. Gehe dazu wieder im Menü auf Gebäude und baue eine Metallmine, danach wieder eine Kristallmine. Um Schiffe bauen zu können musst du zuerst eine Raumschiffswerft gebaut haben. Was dafür benötigt wird findest du links im Menüpunkt Technologie. Das Team wünscht dir viel Spaß beim Erkunden des Universums!',1,1),(1873,1,0,1374563682,15,'Flottenhauptquatier','Expeditionsbericht','Deine Expedition ist auf eine alte Sternenfestung gestoßen, die wohl seit Ewigkeiten verlassen ist. Im Hangar der Festung wurden ein paar Schiffe gefunden. Die Techniker schauen, ob sie einige davon wieder flott bekommen. <br><br>- Es konnten keine Schiffe repariert werden.',0,1),(1874,1,0,1374563832,15,'Flottenhauptquatier','Expeditionsbericht','Deine Flotte ist von der Expedition wieder zurükgekehrt.<br>Sie haben Metall 0, Kristall 0, Deuterium 0 und Dunkle Materie 0 mitgebracht.',0,1),(1875,1,0,1374565059,15,'Flottenhauptquatier','Expeditionsbericht','Deine Flotte ist von der Expedition wieder zurükgekehrt.<br>Sie haben Metall 0, Kristall 0, Deuterium 0 und Dunkle Materie 0 mitgebracht.',0,1),(1880,1,0,1374567121,15,'Flottenhauptquatier','Expeditionsbericht','Unsere Expedition ist auf ein Geisterschiff gestoßen, das eine kleine Menge dunkler Materie transportierte. Wir haben zwar keinerlei Hinweise finden können was der ursprünglichen Crew zugestoßen ist, jedoch gelang es unseren Technikern die Dunkle Materie zu bergen.',0,1),(1883,1,0,1374568498,15,'Flottenhauptquatier','Expeditionsbericht','Deine Flotte ist von der Expedition wieder zurükgekehrt.<br>Sie haben Metall 0, Kristall 0, Deuterium 0 und Dunkle Materie 114 mitgebracht.',0,1),(1884,1,0,1374570119,15,'Flottenhauptquatier','Expeditionsbericht','Wir haben eine verlassene Piratenbasis gefunden. Im Hangar liegen noch einige alte Schiffe. Unsere Techniker schauen nach, ob einige davon noch zu gebrauchen sind.<br>Kleiner Transporter: 1',0,1),(1885,1,0,1374571496,15,'Flottenhauptquatier','Expeditionsbericht','Deine Flotte ist von der Expedition wieder zurükgekehrt.<br>Sie haben Metall 0, Kristall 0, Deuterium 0 und Dunkle Materie 0 mitgebracht.',0,1),(1886,1,0,1374571877,15,'Flottenhauptquatier','Expeditionsbericht','Außer einiger kurioser, kleiner Tierchen von einem unbekannten Sumpfplaneten, bringt diese Expedition nichts Aufregendes von ihrer Reise mit.',0,1),(1887,1,3,1374572085,4,'Devil','Neue Buddylist-Anfrage!','Hallo winemp83,<br>Devil hat dir eine Buddylist-Anfrage gesendet!',0,1),(1890,1,0,1374573254,15,'Flottenhauptquatier','Expeditionsbericht','Deine Flotte ist von der Expedition wieder zurükgekehrt.<br>Sie haben Metall 0, Kristall 0, Deuterium 0 und Dunkle Materie 0 mitgebracht.',0,1),(1891,1,3,1374573394,1,'Devil [1:1:8]','Kein Betreff','Sieht schön aus das man bei der Statistik jetzt auch sieht wer on ist, supi schön! *freu',0,1),(1896,1,0,1374574873,15,'Flottenhauptquatier','Expeditionsbericht','Ein seltsames Computervirus legte kurz nach Verlassen des Sonnensystems die Navigation lahm. Dies führte dazu, dass die gesamte Expeditionsflotte die ganze Zeit im Kreis flog. Überflüssig zu sagen, dass die Expedition nicht besonders erfolgreich war.',0,1),(1901,15,0,1374575647,99,'Bauliste','Bau nicht möglich','Sie verfügen auf Planet Larab <a href=\"?page=buildings&amp;cp=67&amp;re=0\">[1:23:6]</a> nicht über genügend Ressourcen, um mit dem Bau von Metallmine zu beginnen. <br>Sie verfügen über 181.762 Metall , 197.685 Kristall und 11.149 Deuterium. <br>Die Baukosten betragen 199.515 Metall , 49.879 Kristall und 0 Deuterium.',0,1),(1902,1,0,1374576250,15,'Flottenhauptquatier','Expeditionsbericht','Deine Flotte ist von der Expedition wieder zurükgekehrt.<br>Sie haben Metall 0, Kristall 0, Deuterium 0 und Dunkle Materie 0 mitgebracht.',0,1),(1903,1,0,1374577636,15,'Flottenhauptquatier','Expeditionsbericht','Deine Expedition hat wunderschöne Bilder einer Supernova gemacht. Wirklich neue Erkenntnisse hat diese Expedition jedoch nicht gebracht. Aber man hat gute Chancen auf den Bestes-Bild-Des-Universums-Wettbewerb in diesem Jahr.',0,1),(1904,1,0,1374579013,15,'Flottenhauptquatier','Expeditionsbericht','Deine Flotte ist von der Expedition wieder zurükgekehrt.<br>Sie haben Metall 0, Kristall 0, Deuterium 0 und Dunkle Materie 0 mitgebracht.',0,1),(1905,1,0,1374579496,5,'Flottenhauptquatier','Stationierte Flotte','Deine Flotte erreicht den Planeten <a href=\"game.php?page=galaxy&amp;galaxy=1&amp;system=1\" class=\"\">[1:1:1]</a> und liefert 0 Metall, 0 Kristall und 99.984 Deuterium.',0,1),(1906,1,0,1374579549,5,'Flottenhauptquati