INSERT INTO `uni1_ticket_answer` (`answerID`, `ownerID`, `ownerName`, `ticketID`, `time`, `subject`, `message`) VALUES (1,8,'Ic3y',1,1373392089,'','TEst'),(2,1,'winemp83',1,1373393293,'RE: TEST','test bestanden =)'),(3,15,'John',2,1373642323,'','Wenn man eine Bewerbung von jemanden bekommt werden die Punkte von demjenigen angezeigt, der in den Statistiken auf Platz eins ist. [url=https://docs.google.com/file/d/0ByrRfk3h6sStRi1Sakt2Z3E2YkE/edit?usp=sharing]https://docs.google.com/file/d/0ByrRfk3h6sStRi1Sakt2Z3E2YkE/edit?usp=sharing[/url]'),(4,1,'winemp83',2,1373662428,'RE: Allianz Bwerbungen','danke dir ich schau mir das an =)'),(5,15,'John',3,1373701973,'','Ich wollte nur mal sagen dass frank1606 und ich über die gleiche IP spielen (er ist mein Bruder)'),(6,1,'winemp83',3,1373702184,'RE: Gleiche IP','Okay =) \nDann viel Spaß euch beiden \n\nmfg\nwinemp83'),(7,1,'winemp83',3,1373702184,'RE: Gleiche IP','Ticket wurde geschlossen!'),(8,1,'winemp83',2,1373702293,'RE: Allianz Bwerbungen','Für das erfolgreiche Melden eines Bugs erhählst du Folgenden Gutschein:\n\nyZGU1A0V1BOv\n\nNutze ihn weisse.\n\n\nmfg\nWinemp83'),(9,1,'winemp83',1,1373702303,'','Ticket wurde geschlossen!'),(10,15,'John',4,1373705097,'','es wird alles (Bewerbungstext, Punkte, Kampfstatistik,...) doppelt angezeigt [url=https://docs.google.com/file/d/0ByrRfk3h6sStVXJJQk9ON2s5TkU/edit?usp=sharing]https://docs.google.com/file/d/0ByrRfk3h6sStVXJJQk9ON2s5TkU/edit?usp=sharing[/url]'),(11,1,'winemp83',4,1373706317,'RE: Allianz Bwerbungen (doppelt)','Bitte prüfe das gleich noch mal bin grade am Code zugange'),(12,1,'winemp83',4,1373707055,'RE: Allianz Bwerbungen (doppelt)','Bug ist beseitigt!\n\nFür das erfolgreiche melden des Bugs bekommst du folgenden Gutschein:\n\nyZGU1A0V1BOv\n\nmfg\nwinemp83'),(13,1,'winemp83',4,1373707055,'RE: Allianz Bwerbungen (doppelt)','Ticket wurde geschlossen!'),(14,1,'winemp83',2,1373707073,'RE: Allianz Bwerbungen','Der Fehler sollte beseitigt sein'),(15,15,'John',5,1373707815,'','es komm immer der Fehlertext wenn man bei einem support ticket eine Antwort schreiben will [quote]\nWARNING\nMessage: Illegal string offset &#039;status&#039;\nFile: /includes/pages/game/class.ShowTicketPage.php\nLine: 101\nURL: http://test.landoflegends.de/game.php?page=ticket&amp;mode=send\nPHP-Version: 5.5.0-pl0-gentoo\nPHP-API: fpm-fcgi\nMySQL-Cleint-Version: mysqlnd 5.0.11-dev - 20120503 - $Id: 40933630edef551dfaca71298a83fad8d03d62d4 $\n2Moons Version: 1.7.2676\nDebug Backtrace:\n#0 /includes/pages/game/class.ShowTicketPage.php(101): errorHandler(2, &#039;Illegal string ...&#039;, &#039;FILEPATH ...&#039;, 101, Array)\n#1 /game.php(65): ShowTicketPage-&gt;send()\n#2 {main}[/quote]'),(16,15,'John',6,1373723823,'','Ich habe schon mindestens 5 mal Spionage Sonden zu einem Planeten geschickt (2mal eine, 2mal 2) geschickt aber es fehlt immer noch der Hacken bei &quot;Spioniere den Planeten eines Gegners aus&quot;. Spionageberichte habe ich aber bekommen.'),(17,22,'SupCharis',2,1373751116,'','Ticket wurde geschlossen!'),(18,1,'winemp83',5,1373791531,'RE: Support Antwort','Sollte nun gelöst sein bitte testen\n\n\nmfg\nwinemp83'),(19,15,'John',5,1373791596,'','test'),(20,15,'John',5,1373791604,'','ja gelöst'),(21,15,'John',2,1373791688,'','leider nicht gelöst (hatte heute morgen im 10 nachgeschaut)'),(22,1,'winemp83',7,1373791793,'','Kein Bug gefunden'),(23,1,'winemp83',7,1373791816,'','Ticket wurde geschlossen!'),(24,1,'winemp83',2,1373792115,'RE: Allianz Bwerbungen','ich schau noch mal rein'),(25,1,'winemp83',5,1373792199,'RE: Support Antwort','Ffür das erfolgreiche melden eines Bugs Bekommst du folgenden Gutschein:\n\nyZGU1A0V1BOv\n\nNutze ihn weisse\n\nmfg\nwinemp83'),(26,1,'winemp83',5,1373792199,'RE: Support Antwort','Ticket wurde geschlossen!'),(27,1,'winemp83',6,1373792552,'RE: Tutorial 7','Fehler Intern zur Bearbeitung vorgemerkt und zugeteilt\n\n\n,fg\nwinemp83'),(28,14,'olimi',8,1373896755,'','Spionage über das anklicken in der &quot;Galaxie&quot; seite funktioniert nicht'),(29,14,'olimi',8,1373896855,'','hat sich erledigt  hängt wahrscheinlich mit dem noobschutz zusammen'),(30,14,'olimi',9,1373905339,'','Spionage eines gegners klappt nicht bzw. wird nicht abgehackt'),(31,14,'olimi',9,1373905347,'','Mission 7'),(32,15,'John',10,1373906971,'','Wenn man in den Markt ein Angebot reinstellt, dann den Planeten wechselt und dann wieder das Angebot löscht hat man die Ressourcen die man reingestellt hatte auf dem anderem Planeten (sozusagen kostenloser &amp; zeitloser Transport)'),(33,1,'winemp83',10,1373912948,'RE: Markt','ist bekannt wird atm dran gearbeitet'),(34,1,'winemp83',9,1373912968,'RE: Tutorial','ist bekannt wird dran gearbeitet'),(35,1,'winemp83',8,1373912994,'RE: Spionage','Jupp richtig erkannt =)'),(36,1,'winemp83',8,1373912994,'RE: Spionage','Ticket wurde geschlossen!'),(37,7,'master',11,1374069080,'','wenn ich auf spionieren gehen will kommt nur die linkinfo unten im firefox javascript:doit(6,15);\n\ngreetz'),(38,7,'master',11,1374069369,'','hat sich erledigt, ich hab es nicht mitbekommen, weil es keine extra meldung dafür gibt, .\n\nfunzt also alles wie es soll ^^'),(39,1,'winemp83',11,1374094374,'RE: spionage nicht möglich','alles klar'),(40,1,'winemp83',11,1374094374,'RE: spionage nicht möglich','Ticket wurde geschlossen!'),(41,7,'master',12,1374160473,'','ich habe 2 x 5k  kristall in den allianzmarkt eibngestellt.\naber es gibt gar keine möglichkeit es einzusehen, das ich das angebot zurück ziehen kann.\ngreetz'),(42,1,'winemp83',12,1374163500,'RE: alianzmarkt','?\ndu hast bei markt Allianz ausgewählt?'),(43,7,'master',12,1374163589,'','ja hab ich'),(44,7,'master',12,1374166072,'','vergiss mich nicht, wir haben nicht weiter drüber gesprochen ^^'),(45,1,'winemp83',12,1374176444,'RE: alianzmarkt','Doch haben wir'),(46,1,'winemp83',12,1374176444,'RE: alianzmarkt','Ticket wurde geschlossen!'),(47,17,'Rex',13,1374240345,'','hi, mein freund max wurde glaub ich aufgrund von einem 2. Account gesperrt \naber eigentlich wollte er nur seinen ersten accuont löschen weil er da ausversehen vulkanier genommen hat. Da dies allerdings / tege dauert hat er sich schonma einen neuen account gemacht (hat aber wohl verpeilt das zu melden) ich hoffe ihr entsperrt den account wieder ( vll. könnt ihr den famous account auch einfach sofort löschen) \nDanke schon ma im voraus bdw. ist das bei dem toutorial mit den 20 kolonie schiffen euer ernst;-)'),(48,15,'John',14,1374244467,'','Wie komme ich im Forum bei den Benutzergruppen in die eigene Alli rein? Ich kann nur eine Beitrittsanfrage machen aber die kann ja nicht beantwortet werden weil keiner in der Gruppe drin Ist.'),(49,1,'winemp83',13,1374246846,'RE: Account sperrung des &quot;2 Accounts&quot; von max / Famuos','Punkt a) über Max/Famous er möchte mir bitte einen Termin nennen wann er zeit für TS hat.\nPunkt b) ja das ist unser ERnst da du in dieser src. mit Astro 29 Planeten haben kannst\n\n\nmfg\nwinemp83'),(50,1,'winemp83',14,1374246887,'RE: Forum','Bist du der Leader? dann adde ich dir die Grp udn schließe sie dann so ds nur du Dort leute hinzufügen kannst\n\n\nmfg\nwinemp83'),(51,15,'John',14,1374250123,'','ja'),(52,15,'John',14,1374250170,'','gut bin jetzt Gruppenleiter'),(53,1,'winemp83',14,1374255946,'RE: Forum','Jupp =) Sobald deine Allianz member einmal das Forum besucht haben kannst du sie unter : &quot;Gruppen Verwalten&quot; deiner Gruppe zufügen'),(54,1,'winemp83',14,1374255946,'RE: Forum','Ticket wurde geschlossen!'),(55,1,'winemp83',13,1374256831,'RE: Account sperrung des &quot;2 Accounts&quot; von max / Famuos','Max ist entspeert allerdings war das eine einmalige Aktion!\n\nViel Spaß wünscht\nwinemp83'),(56,1,'winemp83',13,1374256841,'','Ticket wurde geschlossen!'),(57,7,'master',15,1374314261,'','Bei meinem Leer Transport wurde ca. die Hälfte der Transportkosten(Deut) auf die Planeten geliefert.\n\n		20. Jul 2013, 11:52:37 	Flottenhauptquatier 	Stationierte Flotte\nDeine Flotte erreicht den Planeten [1:5:7] und liefert 0 Metall, 0 Kristall und 5 Deuterium. \n\n20. Jul 2013, 11:53:05 	Flottenhauptquatier 	Stationierte Flotte\nDeine Flotte erreicht den Planeten [1:5:6] und liefert 0 Metall, 0 Kristall und 4 Deuterium.'),(58,1,'winemp83',15,1374315791,'RE: Bugmeldung Transport','Anerkannt wird geprüft (event reserve DM für unplanmässige verlängerte Reisen)'),(59,7,'master',15,1374332663,'','Habe gerade erfahren das es die ressis nur erstattet gibt wenn nur halbe wege geflogen werden, da die gesamte hin und rückflugstrecke abgezogen wurde...\n\nschade für mich, aber richtig so^^'),(60,1,'winemp83',15,1374403338,'RE: Bugmeldung Transport','Also alles richtig'),(61,1,'winemp83',15,1374403338,'RE: Bugmeldung Transport','Ticket wurde geschlossen!'),(62,1,'winemp83',10,1374416058,'RE: Markt','ist gelöst worden durch dm Kosten beim Abbrechen'),(63,1,'winemp83',10,1374416058,'RE: Markt','Ticket wurde geschlossen!'),(64,26,'Max',16,1374422794,'','[img]http://www.bilder-hochladen.net/files/big/kw47-1-c4ca.gif[/img]\n\nRechtschreibfehler: Standartwebbrowser\n\nmfg Max   :)'),(65,1,'winemp83',16,1374433229,'RE: Login Screen','danke wird bei Zeiten gefixxt'),(66,1,'winemp83',16,1374433229,'RE: Login Screen','Ticket wurde geschlossen!'),(67,1,'winemp83',16,1374433301,'RE: Login Screen','Für das Melden dieses Bugs erhählst du folgenden Gutschein Code:\nyZGU1A0V1BOv'),(68,7,'master',17,1374481307,'','Hab im Nachrichteneingang immer 1 Nachricht stehen, sobald ich rausklicke steht wieder\nNachrichten (1)\n\ngreetz master'),(69,17,'Rex',18,1374487473,'','Hi, im Forum stand ja dass mann ohne astro 7 Kolonien haben kann, ich kann mit astro stufe 3 4 Kolonien machen Lässt sich dass beheben?'),(70,15,'John',19,1374490620,'','Die Rekorde aktualisieren sich zu Langsam. Momentan hab ich 25 Recycler aber in den Rekorden steht noch Devil mit 10 Recycler.'),(71,1,'winemp83',19,1374492166,'RE: Rekorde','wird geprüft'),(72,1,'winemp83',18,1374492193,'RE: Kolonien','wird geprüft'),(73,15,'John',20,1374492210,'','Original text: &quot;Pushen ist grundsätzlich verboten. Als Pushing werden alle Ressourcen-Lieferungen ohne angemessene Gegenleistung [color=#BFBF00] von punktschwächeren Accounts an punktstärkere Accounts [/color] gesehen. Ausnahmen müssen im Vorfeld vom Operator genehmigt werden. Eine fehlende Genehmigung kann eine Sperre wegen Pushens nach sich ziehen. Ein Handel muss innerhalb 24 Stunden abgeschlossen oder bei einem Operator angemeldet sein.&quot;\nDas Gelbe müsste aber &quot;von punkttärkeren Accounts an punktschwächere Accounts&quot; heißen.'),(74,1,'winemp83',17,1374492218,'RE: Nachrichten BUG','dann hast du auch noch eine nachricht schnucki\noder browser cache löschen'),(75,1,'winemp83',20,1374492266,'RE: Regel 3 Pushen','Danke fürs Melden, das Regel werk muss eh noch überarbeitet werden, da durch die eigenen Module neue Möglichkeiten gegeben sind'),(76,15,'John',19,1374492293,'','jetzt ist es aktuell aber ich hatte die 25 schon zeit mindestens 2h'),(77,7,'master',17,1374492335,'','ok, da war noch irgend eine nachricht auf einer vorhergehenden seite xD\nman kann es doch mal versuchen ;)'),(78,1,'winemp83',17,1374492470,'RE: Nachrichten BUG','*lach* klar schnucki'),(79,1,'winemp83',19,1374492521,'RE: Rekorde','Die Rekorde werden anders als die Statistik abgefragt ich muss schauen ob ich das skript umschreiben oder aber anpassen kann'),(80,26,'Max',21,1374592231,'','Wenn man auf z.B auf seinem Hauptplaneten etwas erforscht, kann man bei einer anderen Kolonie kein Forschungslabor bauen bzw. Ausbauen\n\nMax'),(81,1,'winemp83',21,1374599365,'RE: Forschungslabor','das ist richtig so =) leider source abhängig wegen Intergalagtischen Forschungs Netzwerk'),(82,26,'Max',21,1374602292,'','Ok :)'),(83,1,'winemp83',21,1374604612,'','Ticket wurde geschlossen!');
